We all appreciate an extra measure of comfort right now. I think that’s why, every time I’m asked to name my favorite dish from the new cookbook #TheFrenchLaundryPerSe, I like to recommend the Steak and Potatoes. Our take on this recipe is 100-Day Dry-Aged Cote de Boeuf, Braised Brisket “Tater Tots,” and Gem Lettuce Salad with Tony’s Green Goddess Dressing.

@_chefdavidbreeden, at @_tfl_, created this dish based on his memories of how his father relished dipping his steak into the green goddess dressing at his favorite restaurant in their hometown, Greeneville, Tennessee. Called Augustino’s Ristorante, it was also where David got his first job, washing dishes at age sixteen. In keeping with the 1970s theme, Chef Breeden serves the dish with tater tots. And don’t forget to serve them with extra Green Goddess Dressing.

You’ll find this recipe in THE FRENCH LAUNDRY, PER SE, written with @coreydchow, @_chefdavidbreeden, and their teams at @perseny and @_tfl_. Published by @artisan_books. Available now in bookstores and online. For signed copies, visit thomaskeller.com/TheFrenchLaundryPerSeCookbook
